// src/components/VehicleTypeDoughnutChart.js
import React from "react";
import { Doughnut } from "react-chartjs-2";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";

ChartJS.register(ArcElement, Tooltip, Legend);

const VehicleTypeDoughnutChart = ({ data }) => {
  const vehicleTypes = data.reduce((acc, vehicle) => {
    const type = vehicle["Electric Vehicle Type"];
    acc[type] = (acc[type] || 0) + 1;
    return acc;
  }, {});

  const chartData = {
    labels: Object.keys(vehicleTypes),
    datasets: [
      {
        data: Object.values(vehicleTypes),
        backgroundColor: ["#28a745", "#dc3545", "#ffc107"],
      },
    ],
  };

  return (
    <div className="chart-container">
      <h3>Vehicle Type Breakdown</h3>
      <Doughnut data={chartData} />
    </div>
  );
};

export default VehicleTypeDoughnutChart;
